import './App.css';
import Button from '@material-ui/core/Button';

const Home = () => {
    return(
        <div>
        <img src={pokemon} className='pok' alt="home"/>
        <Button>
            Goto Pokedex
        </Button>
        </div>
    )
}

export default Home;
